.van-nav-bar{
    position: relative;
    height: 46px;
    line-height: 46px;
    text-align: center;
    background-color: #fff;
    -webkit-user-select: none;
    user-select: none;
  }
.van-nav-bar__left {
    left: 15px;
}
.van-nav-bar__left, .van-nav-bar__right {
    position: absolute;
    bottom: 0;
    font-size: 14px;
}
.van-nav-bar__right {
    right: 15px;
}
.van-nav-bar__title{
    max-width: 60%;
    margin: 0 auto;
    color: #323233;
    font-weight: 500;
    font-size: 16px;
}
.van-nav-bar__text{
  display: inline-block;
  margin: 0 -15px;
  padding: 0 15px;
  color: #1989fa;
  vertical-align: middle;
}
